import React from "react";
import "../comments/Comment.css";

const Comment = ({ comment }) => {
  return (
    <div className="comment">
      ({comment.name}, {comment.email})
      <br />
      <span className="highlitedText">Comment: </span>
      {comment.body}
    </div>
  );
};

export default Comment;
